        .cropper-dashed {
            border: 0 dashed #eee;
            display: block;
            opacity: 0.5;
            position: absolute;
        }

        .cropper-dashed.dashed-h {
            border-bottom-width: 1px;
            border-top-width: 1px;
            height: calc(100% / 3);
            left: 0;
            top: calc(100% / 3);
            width: 100%;
        }

        .cropper-dashed.dashed-v {
            border-left-width: 1px;
            border-right-width: 1px;
            height: 100%;
            left: calc(100% / 3);
            top: 0;
            width: calc(100% / 3);
        }

        .cropper-center {
            display: block;
            height: 0;
            left: 50%;
            opacity: 0.75;
            position: absolute;
            top: 50%;
            width: 0;
        }

        .cropper-center::before,
        .cropper-center::after {
            background-color: #eee;
            content: ' ';
            display: block;
            position: absolute;
        }

        .cropper-center::before {
            height: 1px;
            left: -3px;
            top: 0;
            width: 7px;
        }

        .cropper-center::after {
            height: 7px;
            left: 0;
            top: -3px;
            width: 1px;
        }

        .cropper-face,
        .cropper-line,
        .cropper-point {
