        .cropper-line.line-n {
            cursor: ns-resize;
            height: 5px;
            left: 0;
            top: -3px;
        }

        .cropper-line.line-w {
            cursor: ew-resize;
            left: -3px;
            top: 0;
            width: 5px;
        }

        .cropper-line.line-s {
            bottom: -3px;
            cursor: ns-resize;
            height: 5px;
            left: 0;
        }

        .cropper-point {
            background-color: #39f;
            height: 5px;
            opacity: 0.75;
            width: 5px;
        }

        .cropper-point.point-e {
            cursor: ew-resize;
            margin-top: -3px;
            right: -3px;
            top: 50%;
        }

        .cropper-point.point-n {
            cursor: ns-resize;
            left: 50%;
            margin-left: -3px;
            top: -3px;
        }

        .cropper-point.point-w {
            cursor: ew-resize;
            left: -3px;
            margin-top: -3px;
            top: 50%;
        }

        .cropper-point.point-s {
            bottom: -3px;
            cursor: s-resize;
            left: 50%;
            margin-left: -3px;
        }

        .cropper-point.point-ne {
            cursor: nesw-resize;
            right: -3px;
            top: -3px;
        }

        .cropper-point.point-nw {
            cursor: nwse-resize;
            left: -3px;
            top: -3px;
        }

        .cropper-point.point-sw {
            bottom: -3px;
            cursor: nesw-resize;
            left: -3px;
        }

        .cropper-point.point-se {
            bottom: -3px;
